DROP TABLE IF EXISTS `wm_act_chic`;
CREATE TABLE `wm_act_chic` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `act_id` int(11) NOT NULL DEFAULT '0' COMMENT '活动id',
  `is_varied` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否能参加品牌活动',
  `after_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '优惠类型,1:优惠多少价格；2：折扣，3：买多少送多少（jm_chic_attr）',
  `after_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '优惠价格（优惠类型--1）',
  `after_discount` float(3,2) unsigned DEFAULT '0.00' COMMENT '优惠折扣-（优惠类型--2）8.50折',
  PRIMARY KEY (`id`),
  KEY `activity_id` (`act_id`),
  KEY `is_varied` (`is_varied`),
  KEY `after_type` (`after_type`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='单品/平台活动属性表';

