DROP TABLE IF EXISTS `wm_act_chic_attr`;
CREATE TABLE `wm_act_chic_attr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `act_chic_id` int(11) NOT NULL DEFAULT '0' COMMENT '单品优惠id',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品id',
  `buy_number` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '购买数量满多少',
  `give_number` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '赠送的数量',
  PRIMARY KEY (`id`),
  KEY `buy_number` (`buy_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='单品/平台活动购买数量满几送几表';

