#
# Structure for table "wm_activity"
#

DROP TABLE IF EXISTS `wm_activity`;
CREATE TABLE `wm_activity` (
  `act_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '活动id',
  `act_name` varchar(255) DEFAULT NULL COMMENT '活动名称',
  `starttime` int(10) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `endtime` int(10) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `content` varchar(255) DEFAULT NULL COMMENT '活动说明',
  `act_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '活动类型：3单品活动表（jm_act_chic）',
  `act_pic` varchar(255) DEFAULT NULL COMMENT '活动图片',
  `act_infopic` varchar(255) DEFAULT NULL COMMENT '活动头部详情图',
  `status` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '活动是否开启',
  `act_bgcolor` varchar(255) DEFAULT NULL COMMENT 'jimao有用，先保留',
  `limit` int(11) DEFAULT NULL COMMENT '本活动每件商品每人限制购买数量',
  `is_delete` tinyint(3) DEFAULT '0' COMMENT '是否启用（0是1否）',
  PRIMARY KEY (`act_id`),
  KEY `starttime` (`starttime`),
  KEY `endtime` (`endtime`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='营销活动';

