CREATE TABLE `wm_address` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `consignee` varchar(10) NOT NULL DEFAULT '' COMMENT '收货人姓名',
  `address` varchar(20) NOT NULL DEFAULT '' COMMENT '详细地址',
  `phone` char(12) NOT NULL DEFAULT '' COMMENT '联系电话',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `is_moren` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '默认地址',
  `province` varchar(255) DEFAULT NULL COMMENT '省',
