# Structure for table "wm_admin"
#

DROP TABLE IF EXISTS `wm_admin`;
CREATE TABLE `wm_admin` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `admin_id` varchar(255) DEFAULT '' COMMENT '管理guid',
  `user` varchar(50) NOT NULL DEFAULT '' COMMENT '管理员账号',
  `password` char(32) NOT NULL DEFAULT '' COMMENT '管理员密码',
  `is_disable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否禁用，1-是，0-否',
  `create_time` char(10) DEFAULT NULL COMMENT '创建时间',
  `is_depart_admin` tinyint(3) DEFAULT NULL COMMENT '是否为分店管理员',
  `depart_id` int(11) DEFAULT NULL COMMENT '所属分店',
  PRIMARY KEY (`id`),
  KEY `admin_id` (`admin_id`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 COMMENT='管理员表';

