  `adv_name` varchar(255) NOT NULL DEFAULT '' COMMENT '广告名',
  `img` varchar(255) NOT NULL DEFAULT '' COMMENT '广告图片',
  `content` varchar(255) DEFAULT '' COMMENT '广告详情',
  `sort_no` tinyint(3) NOT NULL DEFAULT '0' COMMENT '广告顺序:从小到大排序',
  `goods_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sort_no` (`sort_no`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='广告';

