#
# Structure for table "wm_base"
#

DROP TABLE IF EXISTS `wm_base`;
CREATE TABLE `wm_base` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `protocol` text COMMENT '协议',
  `private` text COMMENT '隐私',
  `copyright` text COMMENT '版权',
  `introduction` text COMMENT '玩法介绍',
  `service_tel` varchar(100) DEFAULT NULL COMMENT '客服电话',
  `start_img0` varchar(200) DEFAULT NULL COMMENT '启动画面0',
  `start_img1` varchar(200) DEFAULT NULL COMMENT '启动画面1',
  `start_img2` varchar(200) DEFAULT NULL COMMENT '启动画面2',
  `start_img3` varchar(200) DEFAULT NULL COMMENT '启动画面2',
  `start_img4` varchar(200) DEFAULT NULL COMMENT '启动画面4',
  `logitics_auto_confirm` tinyint(3) DEFAULT NULL COMMENT '物流自动确认时间',
  `distribute_auto_confirm` tinyint(3) DEFAULT NULL COMMENT '派送自动确认时间',
  `distance` int(11) NOT NULL DEFAULT '50000' COMMENT '距离',
  `distribute_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '可选的派送费（元）',
  `close_time` char(10) NOT NULL DEFAULT '0' COMMENT '休眠时间',
  `open_time` char(10) NOT NULL DEFAULT '' COMMENT '开启时间',
  `books` int(11) DEFAULT NULL COMMENT '最低预订天数',
  `countdown` int(11) NOT NULL DEFAULT '0' COMMENT '派送倒计时',
  `yd_one` int(11) DEFAULT NULL COMMENT '预定天数1',
  `yd_two` int(11) DEFAULT '0' COMMENT '预定天数2',
  `yd_three` int(11) DEFAULT '0' COMMENT '预定天数3',
  `yd_four` int(11) DEFAULT '0' COMMENT '预定天数4',
  `yd_five` int(11) DEFAULT '0' COMMENT '预定天数5',
  `yd_six` int(11) DEFAULT '0' COMMENT '预定天数6',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='通用设置';

