DROP TABLE IF EXISTS `wm_comment_reply`;
CREATE TABLE `wm_comment_reply` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `comment_id` mediumint(8) unsigned NOT NULL COMMENT '评论Id',
  `member_id` mediumint(8) unsigned NOT NULL COMMENT '会员Id',
  `content` varchar(200) NOT NULL COMMENT '内容',
  `addtime` char(10) DEFAULT NULL COMMENT '回复时间',
  `admin_id` varchar(50) NOT NULL DEFAULT '' COMMENT '管理员id',
  PRIMARY KEY (`id`),
  KEY `comment_id` (`comment_id`),
  KEY `member_id` (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品评论回复表';

