DROP TABLE IF EXISTS `wm_departs`;
CREATE TABLE `wm_departs` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id为1表示总店',
  `depart_no` varchar(255) DEFAULT NULL COMMENT '店铺编号',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '供应商名',
  `tel` char(11) DEFAULT NULL COMMENT '联系电话',
  `create_time` char(10) NOT NULL DEFAULT '' COMMENT '创建时间',
  `is_disable` int(1) NOT NULL DEFAULT '0' COMMENT '0启用1禁用',
  `address` varchar(255) DEFAULT NULL COMMENT '店铺地址',
  `longitude` float DEFAULT NULL COMMENT '分店经度',
  `latitude` float DEFAULT NULL COMMENT '分店纬度',
  `is_delete` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否被删除',
  `round` text COMMENT '范围坐标集，',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='分店管理';

