# Structure for table "wm_distribute_log"
#

DROP TABLE IF EXISTS `wm_distribute_log`;
CREATE TABLE `wm_distribute_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `distributor_id` int(11) NOT NULL DEFAULT '0' COMMENT '派送员ID',
  `distributor_name` varchar(255) DEFAULT NULL COMMENT '派送员名字',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单编号',
  `event_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '事件类型，0为开始派送，1为送达，2为派送员交替',
  `event_time` int(10) DEFAULT NULL COMMENT '事件时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3291 DEFAULT CHARSET=utf8 COMMENT='派送记录';

