DROP TABLE IF EXISTS `wm_distributors`;
CREATE TABLE `wm_distributors` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `distributor_no` varchar(255) DEFAULT NULL COMMENT '派送员编号',
  `distributor_name` char(20) NOT NULL DEFAULT '' COMMENT '派送员昵称',
  `distributor_tel` varchar(255) DEFAULT NULL COMMENT '电话',
  `is_disable` tinyint(3) DEFAULT '0' COMMENT '是否禁启',
  `is_delete` tinyint(3) DEFAULT '0' COMMENT '是否删除',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='派送员表';

