DROP TABLE IF EXISTS `wm_feedback`;
CREATE TABLE `wm_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `member_id` varchar(255) DEFAULT NULL COMMENT '会员id',
  `content` varchar(8000) DEFAULT 'content' COMMENT '内容',
  `creat_time` int(11) DEFAULT NULL,
  `is_reply` int(11) DEFAULT '0',
  `replytext` varchar(8000) DEFAULT NULL COMMENT '回复',
  `reply_time` int(11) DEFAULT NULL COMMENT '回复时间',
  `type` varchar(255) DEFAULT NULL COMMENT '类型',
  `contact` varchar(255) DEFAULT NULL COMMENT '联系方式',
  `userphone` varchar(255) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL COMMENT '用户名，包括会员和派送员',
