DROP TABLE IF EXISTS `wm_finance`;
CREATE TABLE `wm_finance` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员id',
  `type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '类别（0充值、1提现、2手机充值，3退款）',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '处理状态（2未完成、0已完成、1已拒绝）',
  `op_time` varchar(255) NOT NULL DEFAULT '' COMMENT '操作时间',
  `finance_change` varchar(255) DEFAULT NULL COMMENT '变动金额',
  `bank_id` varchar(255) NOT NULL DEFAULT '' COMMENT '账户变动对应的账户（银行、支付宝，微信）',
  `account_number` varchar(255) NOT NULL DEFAULT '' COMMENT '账号',
  `open_account` char(20) DEFAULT NULL COMMENT '开户行',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='财务管理';

