#
# Structure for table "wm_goods"
#

DROP TABLE IF EXISTS `wm_goods`;
CREATE TABLE `wm_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `class_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类Id',
  `goods_no` int(11) NOT NULL DEFAULT '0' COMMENT '商品id',
  `goods_name` varchar(150) NOT NULL DEFAULT '' COMMENT '商品名称',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `shop_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现价',
  `goods_desc` text COMMENT '商品描述',
  `is_on_sale` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否上架',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否放到回收站',
  `addtime` char(10) NOT NULL DEFAULT '' COMMENT '添加时间',
  `sm_logo` varchar(150) DEFAULT '' COMMENT '小图',
  `mid_logo` varchar(150) DEFAULT '' COMMENT '中图',
  `is_new` tinyint(1) DEFAULT '0' COMMENT '是否新品',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '是否热卖',
  `is_best` tinyint(1) DEFAULT '0' COMMENT '是否精品',
  `sort_num` tinyint(3) unsigned DEFAULT '100' COMMENT '排序的数字',
  `is_floor` tinyint(1) DEFAULT '0' COMMENT '是否推荐',
  `sell_start` char(10) DEFAULT '' COMMENT '开始售卖时间',
  `sell_end` char(10) DEFAULT '' COMMENT '结束售卖时间',
  `is_bookable` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否可预订1是0否',
  `book_max` int(11) DEFAULT NULL COMMENT '预定最大数量',
  `virtual_sell_amount` int(11) DEFAULT NULL COMMENT '虚拟销量（可人为修改）',
  `make_way` smallint(6) DEFAULT NULL COMMENT '制作工艺，1为加工类，0为非加工类',
  `transport_price` decimal(10,2) DEFAULT NULL COMMENT '运费',
  `is_stock` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否需要库存:1是，0否',
  `goods_status` tinyint(3) DEFAULT '0' COMMENT '是否出售（0是1否）',
  `sellstart` char(10) DEFAULT NULL COMMENT '每日出售时间',
  `sellend` char(10) DEFAULT NULL COMMENT '每日停售时间',
  `bookday` int(11) NOT NULL DEFAULT '0' COMMENT '最小可预订的天数',
  `is_monthly` tinyint(3) NOT NULL DEFAULT '1' COMMENT '1 包月 2非包月',
  `real_sell_amount` int(11) NOT NULL DEFAULT '0' COMMENT '真实销量',
  PRIMARY KEY (`id`),
  KEY `shop_price` (`shop_price`),
  KEY `addtime` (`addtime`),
  KEY `is_on_sale` (`is_on_sale`)
) ENGINE=InnoDB AUTO_INCREMENT=985 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品信息表';

