INSERT INTO `wm_goods` VALUES (1,41,1,'蛋糕',0.00,0.00,'<p>黑森林蛋糕由来</p><p>其实<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%BB%91%E6%A3%AE%E6%9E%97%E8%9B%8B%E7%B3%95\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">黑森林蛋糕</a>(Schwarzwaelder Kirschtorte)若翻译成“黑森林樱桃奶油蛋糕”应<a class=\"lemma-album layout-right nslog:10000206\" title=\"制作生日蛋糕的材料\" href=\"https://baike.baidu.com/pic/%E7%94%9F%E6%97%A5%E8%9B%8B%E7%B3%95/440299/281777/00a82701dc8fd3427aec2c5a?fr=lemma&ct=cover\" target=\"_blank\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 221px; border-bottom: 0px; margin: 10px 0px; position: relative; float: right; clear: right;\"></a></p><p><a class=\"lemma-album layout-right nslog:10000206\" title=\"制作生日蛋糕的材料\" href=\"https://baike.baidu.com/pic/%E7%94%9F%E6%97%A5%E8%9B%8B%E7%B3%95/440299/281777/00a82701dc8fd3427aec2c5a?fr=lemma&ct=cover\" target=\"_blank\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 221px; border-bottom: 0px; margin: 10px 0px; position: relative; float: right; clear: right;\"><img class=\"picture\" alt=\"制作生日蛋糕的材料\" src=\"http://27.151.0.193/ueditor/php/upload/image/20180106/1515227114486271.jpg\"/></a></p><p><a class=\"lemma-album layout-right nslog:10000206\" title=\"制作生日蛋糕的材料\" href=\"https://baike.baidu.com/pic/%E7%94%9F%E6%97%A5%E8%9B%8B%E7%B3%95/440299/281777/00a82701dc8fd3427aec2c5a?fr=lemma&ct=cover\" target=\"_blank\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 221px; border-bottom: 0px; margin: 10px 0px; position: relative; float: right; clear: right;\">制作生日蛋糕的材料<span class=\"number\" style=\"display: inline; color: gray;\">(13张)</span></a></p><p>&nbsp;该是较恰当吧。因为德文全名里的Schwarzwaelder即为黑森林，而Kirschtorte也就是樱桃奶油蛋糕的意思。仔细研究研究，黑森林说穿了，真的只是一种“没有巧克力的樱桃奶油蛋糕”。相传古早以前，每当黑森林区的樱桃丰收时，农妇们除了将过剩的樱桃制成果酱外，在做蛋糕时，也会非常大方地将樱桃塞在蛋糕的夹层里，或是一颗颗细心地装饰在蛋糕上。而在打制蛋糕的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%B2%9C%E5%A5%B6%E6%B2%B9\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">鲜奶油</a>时，更会加入不少樱桃汁～而这种以樱桃与鲜奶油为主的蛋糕，从黑森林传到外地后，也就变成所谓的“<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%BB%91%E6%A3%AE%E6%9E%97%E8%9B%8B%E7%B3%95\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">黑森林蛋糕</a>”了！ 虽然德国大部份的糕饼师傅在制做黑森林时，也会使用了不少巧克力，不过黑森林蛋糕真正的主角，还是那鲜美丰富的樱桃哦。以前德国曾出现消费者因某家黑森林蛋糕的樱桃含量太少而提出控告的案例～也因此德国政府对这种国宝级黑森林，也作出了相关的规定，像是黑森林蛋糕的鲜奶油部份，就至少得含有80克的樱桃汁才行。所以黑森林呀，真的不是代表黑黑的意思。而黑森林蛋糕，更不是<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B7%A7%E5%85%8B%E5%8A%9B%E8%9B%8B%E7%B3%95\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">巧克力蛋糕</a>的代名词！黑森林是位于德国西南的一个山区，从<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B7%B4%E7%99%BB%E5%B7%B4%E7%99%BB\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">巴登巴登</a>Baden Baden往南一直到佛来堡Freiburg这带，都属黑森林区。今天即使来到黑森林，并不见得到处都能幸运地尝到没有巧克力的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%BB%91%E6%A3%AE%E6%9E%97%E8%9B%8B%E7%B3%95\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">黑森林蛋糕</a>，不过有机会在此地享受黑森林时，不妨细心留意蛋糕里的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B0%8F%E6%A8%B1%E6%A1%83\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">小樱桃</a>，让自己重新认识黑森林外，别忘了也感受一下那份藏于味蕾深处的新鲜感哦。</p><p></p><p><a class=\"image-link\" href=\"https://baike.baidu.com/pic/%E7%94%9F%E6%97%A5%E8%9B%8B%E7%B3%95/440299/0/b9d8b701f49e3f4f1c958345?fr=lemma&ct=single\" target=\"_blank\" title=\"\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 220px; height: 220px;\"><img class=\"\" src=\"http://27.151.0.193/ueditor/php/upload/image/20180106/1515227115130697.jpg\" alt=\"\"/></a></p><p>维也纳<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B7%A7%E5%85%8B%E5%8A%9B%E6%9D%8F%E4%BB%81%E8%9B%8B%E7%B3%95\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">巧克力杏仁蛋糕</a>的由来</p><p>Hotel Imperial开幕于公元1873年，曾经是权贵的集中地方。从帝国时期的“k.u.k Hof-imperial”到后来“Hotel lmperial”一直都是<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A5%A5%E5%9C%B0%E5%88%A9\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">奥地利</a>最好的旅馆。1994年更被评选为世界最好的饭店之一。这里还有一个小传说，当年为了庆祝饭店的开幕并彰显皇帝Franz-joseph的荣耀，一糕饼师傅Xaver Loibner所<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%83%98%E7%84%99\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">烘焙</a>出来的特殊口感的蛋糕，不仅得到皇帝的喜爱，更将之命名为“Imperial Torte”，且被视为“甜密的问候”。细细地品尝，首先，您会尝到蛋糕外层的可口的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%89%9B%E5%A5%B6%E5%B7%A7%E5%85%8B%E5%8A%9B\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">牛奶巧克力</a>伴随着甜美的杏仁味在舌尖缓缓融化，接着蛋糕中的碎杏仁充满您的味觉，并随着丝丝可可亚的香味释出，完美而细腻的留住在口中。</p><p><br/></p>',1,1,'1515227140','2018-01-06/5a50880448858.jpg','2018-01-06/5a50880448a75.jpg',0,0,0,100,0,'','',1,11,2,1,NULL,1,0,'31539600','31582800',0,1,6),(2,2,2,'软盒牡丹3',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180108/1515383735801820.png\" title=\"1515383735801820.png\" alt=\"35软盒牡丹3.png\"/></p>',0,0,'1515390813','2018-01-08/5a52ebca32e14.png','2018-01-08/5a52ebca3333e.png',0,0,0,100,0,'','',1,111,0,1,NULL,1,0,'31539600','31582800',0,0,0),(3,2,3,'七匹狼（豪迈）',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180108/1515389752761488.png\" title=\"1515389752761488.png\" alt=\"34七匹狼(豪迈).png\"/></p>',0,0,'1515389760','2018-01-08/5a53034015f9c.png','2018-01-08/5a5303401653b.png',0,0,0,100,0,'','',1,999,0,1,NULL,1,0,'31539600','31582800',0,2,0),(4,2,4,'云烟（细支大重九）',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180108/1515389829859247.png\" title=\"1515389829859247.png\" alt=\"159云烟(细支大重九).png\"/></p>',0,0,'1515389841','2018-01-08/5a530391c2738.png','2018-01-08/5a530391c2bc7.png',0,0,0,100,0,'','',1,999,0,1,NULL,1,0,'31539600','31582800',0,2,0),(5,2,5,'石狮(软富健)',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180108/1515391119982335.png\" title=\"1515391119982335.png\" alt=\"1石狮(软富健).png\"/></p>',0,1,'1515391178