,'2018-01-12/5a581739afb4b.jpg',0,0,0,100,0,'','',1,100,200,1,NULL,1,0,'31539600','31582800',0,1,2),(309,1,309,'星空棒棒糖-送礼专用',0.00,0.00,'<p><span style=\"font-weight: 700;\">星空棒棒糖语物是什么？</span></p><p>太阳物语：自信、自我。</p><p>水星物语、无形、幻想，神秘主义<span style=\"font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: default; padding: 0px 2px;\">[1]</span><a class=\"sup-anchor\" style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\">&nbsp;</a>&nbsp;。</p><p>金星物语：积极、主动，理想的男性。</p><p>地球物语：希望与期待，有着万世的神话。</p><p>火星物语：爱情、婚姻，理想的女性。</p><p>木星物语：成长、拓展，信仰与教育。</p><p>土星物语：约束、纪律，限制于挑战。</p><p>天王星物语：变革、自由，后知后觉者。</p><p>海王星物语：心智、自知，沟通与旅行。</p><p>冥王星物语：神秘主义。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">用料</h2><table class=\"table-view log-set-param\"><tbody><tr class=\"firstRow\"><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">材料<br/>　　</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">用量</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">星空棒棒糖模具</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">随意</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">星空图案糯米纸</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">适量</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">深色部分半球</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\"><br/></td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">珊瑚糖</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">80克</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">水</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">盖过话梅的份量，多一点煮久一点出味更好</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">自己喜欢口味的话梅（我买的是带有咸味的大个的话梅皇）</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">三颗</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">黑糖</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">70克</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">透明部分半球</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\"><br/></td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">珊瑚糖</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">150克</td></tr><tr><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">水</td><td width=\"327\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; line-height: 22px; border-color: rgb(230, 230, 230);\">30克</td></tr></tbody></table><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">做法</h2><table width=\"99%\" class=\"transparentBorder\"><tbody><tr class=\"firstRow\"><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">1. 在模具上抹一层油方便脱模。放好棍子。</td><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><br/></td></tr><tr><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">2. 先做没有棍子的一边糖果。具体操作请参考我的另一个菜谱“水晶棒棒糖”。将煮好的糖浆搅拌到气泡消除得差不多时，倒进没有棍子的那一边模具里，稍冷却后将糯米纸正面朝下放在糖浆表面，边缘用手指轻轻按压使贴合。冷却后脱模。</td><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><br/></td></tr><tr><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">3. 把话梅和水放到锅子里加热，直到水份蒸发只剩下少量的水。把话梅取出。</td><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><br/></td></tr><tr><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">4. 把黑糖和珊瑚糖加入锅里，烧到165摄氏度之后离火。</td><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><br/></td></tr><tr><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">5. 把黑糖话梅糖浆倒进已经事先放好棍子的一边模具里，注意不要倒太满。</td><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><br/></td></tr><tr><td align=\"left\" valign=\"top\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">6. 稍冷却后把之前做好的透明半球放到深色半球上，彻底冷却后脱模即成。</td><td width=\"100\" align=\"center\" valign=\"middle\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><p><a class=\"image-link\" href=\"https://baike.baidu.com/pic/%E6%98%9F%E7%A9%BA%E6%A3%92%E6%A3%92%E7%B3%96/17171279/0/d4628535e5dde711619ee263a3efce1b9c1661d3?fr=lemma&ct=single\" target=\"_blank\" title=\"\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 220px; height: 166px;\"><img class=\"\" src=\"http://27.151.0.193/ueditor/php/upload/image/20180112/1515739273769701.jpg\" alt=\"\"/></a></p></td></tr><tr><td align=\"left\" valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\">7有必要的话可以用直冲火枪喷射，让这个糖果看上去更完美</td><td align=\"left\" valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"margin: 0px; padding: 0px; line-height: 22px; border-color: rgb(255, 255, 255) !important;\"><br/></td></tr></tbody></table><p><br/></p>',1,1,'1515740215','2018-01-12/5a5858a925035.jpg','2018-01-12/5a5858a925267.jpg',0,0,0,100,0,'','',1,23,12,1,NULL,1,0,'31539600','31582800',0,1,5),(310,1,310,'33',0.00,0.00,'',1,1,'1516009503','2018-01-15/5a5c781f09cd8.jpg','2018-01-15/5a5c781f0a201.jpg',0,0,0,100,0,'','',1,100,200,1,NULL,1,0,'31539600','31582800',0,1,0),(311,1,311,'青岛奥古特330ML',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180116/1516111915213718.jpg\" title=\"1516111915213718.jpg\" alt=\"1.jpg\"/></p>',1,0,'1520172604','2018-01-16/5a5e083036baf.jpg','2018-01-16/5a5e08303702c.jpg',0,0,0,100,0,'','',1,99,345,1,NULL,1,0,'31539600','31582800',0,0,264),(312,1,312,'青岛大优500ML',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180116/1516112135256616.jpg\" title=\"1516112135256616.jpg\" alt=\"1.jpg\"/></p>',1,0,'1522666819','2018-01-16/5a5e090c22d04.jpg','2018-01-16/5a5e090c23258.jpg',0,0,0,100,0,'','',1,99,532,1,NULL,1,0,'31539600','31582800',0,0,680),(313,1,313,'喜力250ML瓶装',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180116/1516112327934654.jpg\" title=\"1516112327934654.jpg\" alt=\"1.jpg\"/></p>',1,0,'1520172542','2018-01-16/5a5e09c9f1310.jpg','2018-01-16/5a5e09c9f1798.jpg',0,0,0,100,0,'','',1,99,4