.193/ueditor/php/upload/image/20180402/1522683033929878.jpg\" title=\"1522683033929878.jpg\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180402/1522683033632778.png\" title=\"1522683033632778.png\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180402/1522683033567847.png\" title=\"1522683033567847.png\"/></p><p><br/></p>',0,0,'1522683180','2018-04-02/5ac24c9ed573e.jpg','2018-04-02/5ac24c9ed5ad9.jpg',0,0,0,100,0,'','',1,100,200,1,NULL,1,0,'31539600','31582800',0,0,20),(565,36,565,'推广 V 盘锦天禹AAA顶级品质大米50斤',0.00,0.00,'<p><br/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394235568093.jpg\" title=\"1531394235568093.jpg\" alt=\"big20140918173422.jpg\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394373636166.png\" title=\"1531394373636166.png\" alt=\"千鹤米业厂区图.png\"/></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\">盘锦市，</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">地处北纬</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-variant-ligatures: normal;orphans: 2;widows: 2;font-family: &#39;Times New Roman&#39;, serif;font-size: 21px;background: rgb(255, 255, 255)\">40</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">°</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-variant-ligatures: normal;orphans: 2;widows: 2;font-family: &#39;Times New Roman&#39;, serif;font-size: 21px;background: rgb(255, 255, 255)\">39</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">′—</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-variant-ligatures: normal;orphans: 2;widows: 2;font-family: &#39;Times New Roman&#39;, serif;font-size: 21px;background: rgb(255, 255, 255)\">41</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">°</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-variant-ligatures: normal;orphans: 2;widows: 2;font-family: &#39;Times New Roman&#39;, serif;font-size: 21px;background: rgb(255, 255, 255)\">27</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">′</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">东经<span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;color: rgb(0, 102, 0);background: transparent\">121°31′</span>～<span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;color: rgb(0, 102, 0);background: transparent\">122°28′</span>之间，</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">属暖温带大陆性半湿润季风气候</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\">气候，这裡河流纵横，沟渠坑塘星罗棋布。</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">是世界上生态系统保存最完好的区域之一，</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\">被联合国命名为「全球生态<span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;color: rgb(0, 102, 0);background: transparent\">500</span>佳」城市，有北方生态第一市的美誉。这裡四季分明，水稻生长季节热量资源丰富，雨热同季，日照充足，</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">无霜期长达<span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;color: rgb(0, 102, 0);background: transparent\">175</span>天左右，非常有利于水稻的生长以及籽粒的灌浆、定浆，最大限度地保证了水稻的成熟度和水稻的营养积淀，因而盘锦大米具有晶莹剔透，色泽油润，颗粒完整，胶稠度高、糊化度低等优良品质。烹煮后米饭清香四溢、入口爽滑劲道，香醇可口。</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\">&nbsp;独</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: rgb(255, 255, 255)\">得天独厚的生态条件和气候条件为盘锦大米的育成提供了难以复制的天然绿色的生态环境。</span><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\">盘锦因此也被中国粮食行业协会授予“中国生态稻米之乡”。</span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394394521175.jpg\" title=\"1531394394521175.jpg\" alt=\"大禹治水，天禹制米.jpg\"/></span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">大禹治水</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">天禹制米</span></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">大禹治水：尧舜时期，黄河流域经常洪水泛滥，为了保护农业生产，大禹担当起治理洪水的重任。他该“堵”为“疏”，把洪水引入疏通的河道或洼地后合同四海。大禹治水居外</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">13</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">年，三过家门而不入。不畏艰苦、身先士卒、因势利导、克服重重困难，成功平息了水患，使百姓安居乐业。是中国历史上第一位成功治理黄河水患的治水英雄，因此也成为了一代君王。</span></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">天禹制米</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">:</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">得益于大禹治水的农业发展，人们意识到水利是农业进步的最大推动力，盘锦千鹤米业得此启发。以大禹治水的精神：</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">专注</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">敬业</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">引领</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">奉献作为企业精神去制米“天禹”牌大米由此得名。</span></span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"><br/></span></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394428833440.jpg\" title=\"1531394428833440.jpg\" alt=\"千鹤米业绿色水稻种植基地.jpg\"/></p><p><br/></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">专属基地</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">自然天成：</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">盘锦千鹤米业天禹牌大米绿色水稻种植基地位于</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">辽河下游退海冲击形成的辽河三角洲平原</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">该区域</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">有甘甜纯净丰饶若乳的西辽河水灌溉，又无“工业三废”污染，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">耕层土壤</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">偏碱性，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">土壤中</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">富含氮、磷、钾和有机质等有益物质</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">均为水稻生长和发育提供了所需的天然肥料。</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">由气候、水分、土壤等条件的优化组合为“天禹”牌盘锦大米的生理和生化过程物质代谢创立了稳定的生态环境。基地内严格按照生产绿色食品的农业技术操作规程进行农事作业，都为生产优质的“天禹”盘锦大米奠定了基础。&nbsp;通过增施有机肥，减少化肥用量及采用生物和物理措施（诸如：施用生物有机肥，采用农业措施综合防治病虫害，实行机械、人工灭草和放养河蟹灭草等），来防治病虫害，确保水稻不受污染。一方面生产出优质的“天禹”牌大米，一方面又保护了生态环境。大力发展稻田养蟹，推广立体种养技术，实现稻蟹、同生同收。生态的种植方法，科学安全、绿色生态。</span></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">守护盘锦的味道</span></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/></span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp;&nbsp;&nbsp; 盘锦大米作为盘锦最鲜明的特产，在饮食多元化的今天，人们并没有忘记那米饭醇香的味道，许多人把这种熟悉的味道称为“盘锦的味道”</span></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: rgb(0, 102, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">“天禹”牌盘锦大米，是盘锦土生土长的品牌，以伴随国内消费者10多年了，期间荣获盘锦市著名商标、辽宁省著名商标，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">“天禹”牌系列大米先后被农业部农产品质量安全中心认定为无公害农产品、中国绿色食品发展中心认定为绿色食品。经过多年的发展和经营</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">“天禹”牌系列大米又先后被认定为辽宁省名牌产品（</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">2011</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">）辽宁名牌农产品（</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">2013</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">）等多项殊荣。</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">并在十二运期间经上级质监局、药监局、农委等有关部门检验与审核被选定为</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; color: black; font-size: 16pt; background: transparent;\">中华人民共和国第十二届运动会盘锦赛区运动员指定用米。</span></span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"><br/></span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394464919134.jpg\" title=\"1531394464919134.jpg\" alt=\"天禹品牌系列产品.jpg\"/></span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"></span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">塑造中国粮食产业的卓越品牌</span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">&nbsp;<br/></span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">&nbsp;&nbsp;&nbsp; 多年来</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">盘锦千鹤米业有限公司，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">“以质量求生存</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">,</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">以市场为导向，以信誉求发展”的经营理念，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">依托于独特的区位优势始终坚持产业化运作、标准化控制、组织化保障、科学化管理、品牌化经营、科技化支撑的运行模式，公司始终坚持专注</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">敬业</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">引领</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">▪</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">奉献的企业精神</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">和“为耕者谋利，为食者谋福”的企业宗旨。公司严格把控原粮质量关，采取公司+基地+家庭农场+农户+科研的经营模式统筹规划，建立了2万亩优质稻米绿色基地的同时，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">不惜重金引进国内先进的大米生产线两条，从原粮如车间到成品出库再到公司统一封闭式的物流配送。在整个加工流程实现自动化的同时也</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">使每一个环节都保证产品的生态、健康、安全。</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">随着经济的飞速发展，人们的文化修养和生活品质在逐年提高，消费者对大米的需求已经不仅仅是对日常消费品的物质感受，而是对高品质的大米带来的健康与安心的生活感受。千鹤人一直致力于“安全米、放心米、营养米、生态米”的生产，正</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background: transparent;\">因为有了消费者您的认可和信赖，千鹤米业才能取得盘锦市守合同重信用单位、盘锦市放心粮油进农村进社区示范加工企业、辽宁省农业产业化重点龙头企业、全国放心粮油进农村进社区示范工程加工企业等多项殊荣。</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-size: 16pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">面对未来，千鹤人将以“时不我待的紧迫感、舍我其谁的使命感”带领粮食产业跨步前进，用“诚信和品质”塑造中国粮食产业的卓越品牌，愿携手与您共进，共创更加灿烂辉煌的明天。</span></p><p><span style=\";padding: 0px;border: 0px;outline: 0px;list-style-type: none;font-weight: bold;font-family: 宋体;font-variant-ligatures: normal;orphans: 2;widows: 2;font-size: 21px;background: white\"></span></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394962415434.jpg\" title=\"1531394962415434.jpg\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394964874811.jpg\" title=\"1531394964874811.jpg\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394967214345.jpg\" title=\"1531394967214345.jpg\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394968402097.jpg\" title=\"1531394968402097.jpg\"/></p><p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180712/1531394971371163.jpg\" title=\"153139497