ng: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">“好米源自好产地”。</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">本公司绿色水稻种植基地位于辽河下游的退海冲积平原—辽河三角洲区域，种植区内耕层土壤</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">偏碱性，</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">土壤中所</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">蕴含氮、磷、钾和有机质等有益物质</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">均为水稻生长和发育提供了所需的天然肥料。这里光照充足、四季分明、雨热同季、无霜期长达175天左右，非常有利于水稻的营养积淀，因而盘锦大米具有晶莹剔透，色泽油润，颗粒完整，胶稠度高、糊化度低等优良品质。烹煮后米饭清香四溢、入口爽滑劲道，香醇可口。</span></p><p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">随着经济的飞速发展，人们的文化修养和生活品质在逐年提高，消费者对大米的需求已经不仅仅是对日常消费品的物质感受，而是对高品质的大米带来的健康与安心的生活感受。千鹤人一直致力于“安全米、放心米、营养米、生态米”的生产，正</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background: transparent;\">因为有了消费者您的认可和信赖，千鹤米业才能取得盘锦市守合同重信用单位、盘锦市放心粮油进农村进社区示范加工企业、辽宁省农业产业化重点龙头企业、全国放心粮油进农村进社区示范工程加工企业等多项殊荣。</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">面对未来，千鹤人将以“时不我待的紧迫感、舍我其谁的使命感”带领粮食产业跨步前进，用</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">“</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">诚信和品质</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">”</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; list-style-type: none; font-weight: bold; color: black; font-size: 18pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">塑造中国粮食产业的卓越品牌，愿携手与您共进，共创更加灿烂辉煌的明天。</span></p><p><br/></p>',0,0,'1527004807','2018-04-18/5ad7315f4dd6e.jpg','2018-04-18/5ad7315f4e04d.jpg',0,0,0,100,0,'','',1,99,174,1,NULL,1,0,'31539600','31582800',0,0,879),(856,57,856,'香格里火锅鲜味王150G',0.00,0.00,'<p><img src=\"http://27.151.0.193/ueditor/php/upload/image/20180425/1524655569727860.jpg\" title=\"1524655569727860.jpg\" alt=\"TB11JyuKFXXXXXWXFXXXXXXXXXX_!!0-item_pic.jpg\"/><img src=\"http://27.151.0.