DROP TABLE IF EXISTS `wm_goods_main`;
CREATE TABLE `wm_goods_main` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `main_name` varchar(255) NOT NULL DEFAULT '' COMMENT '主类名',
  `main_pic` varchar(255) NOT NULL DEFAULT '' COMMENT '主类图',
  `is_disable` int(11) NOT NULL DEFAULT '0' COMMENT '是否禁用',
  `is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='主类型表';

