#
# Structure for table "wm_goods_management"
#

DROP TABLE IF EXISTS `wm_goods_management`;
CREATE TABLE `wm_goods_management` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` char(32) NOT NULL DEFAULT '0' COMMENT '商品id',
  `depart_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `specifications` char(10) DEFAULT NULL COMMENT '规格',
  `stock` mediumint(9) NOT NULL DEFAULT '1' COMMENT '商品库存',
  `goods_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '商品状态，是否停售，1停售，0出售',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `shop_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现价',
  `stock_all` int(11) DEFAULT NULL COMMENT '库存总量',
  `depart1_mid` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4526 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商品库存表';

