#
# Structure for table "wm_logistics_info"
#

DROP TABLE IF EXISTS `wm_logistics_info`;
CREATE TABLE `wm_logistics_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `l_id` int(11) NOT NULL DEFAULT '0' COMMENT '物流记录id',
  `transfer_time` char(10) NOT NULL DEFAULT '' COMMENT '流转时间',
  `transfer_content` varchar(255) NOT NULL DEFAULT '' COMMENT '流转详情',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='物流明细表';

#
# Data for table "wm_logistics_info"
#


#
# Structure for table "wm_logistics_log"
#

DROP TABLE IF EXISTS `wm_logistics_log`;
CREATE TABLE `wm_logistics_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `class_id` int(11) NOT NULL DEFAULT '0' COMMENT '物流类型',
  `order_id` varchar(255) NOT NULL DEFAULT '' COMMENT '订单编号',
  `consignee` varchar(255) NOT NULL DEFAULT '' COMMENT '收货人姓名',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '售后地址',
  `tel` char(20) NOT NULL DEFAULT '0' COMMENT '电话',
  `logistics_id` varchar(255) NOT NULL DEFAULT '' COMMENT '物流单号',
  `dynamic` varchar(255) NOT NULL DEFAULT '' COMMENT '物流动态',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '最新物流状态0派送中1已经送达',
  `create_time` char(10) NOT NULL DEFAULT '' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='物流记录';

