#
# Structure for table "wm_member"
#

DROP TABLE IF EXISTS `wm_member`;
CREATE TABLE `wm_member` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `userphone` char(11) NOT NULL DEFAULT '' COMMENT '注册手机号码',
  `password` char(32) NOT NULL DEFAULT '' COMMENT '密码',
  `username` varchar(50) NOT NULL DEFAULT '' COMMENT '用户名',
  `useremail` varchar(50) NOT NULL DEFAULT '' COMMENT '用户邮箱',
  `userphoto` varchar(100) NOT NULL DEFAULT '' COMMENT '用户头像',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '账户余额',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `gold` int(10) NOT NULL DEFAULT '0' COMMENT '积分',
  `exp` int(10) NOT NULL DEFAULT '0' COMMENT '经验值',
  `is_disable` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否禁用，1-是，0-否',
  `disable_reason` varchar(100) NOT NULL DEFAULT '' COMMENT '禁用原因',
  `is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '0显示，1不显示',
  `m_code` varchar(255) NOT NULL DEFAULT '0' COMMENT '邀请码',
  `everydaytime` char(10) NOT NULL DEFAULT '0' COMMENT '每日签到时间',
  `register` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否领取注册',
  `buy` int(11) unsigned NOT NULL DEFAULT '2' COMMENT '是否领取首次购买 2未满足条件',
  `evaluate` int(11) unsigned NOT NULL DEFAULT '2' COMMENT '是否领取首次评价 2未满足条件',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=644 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会员表';

