DROP TABLE IF EXISTS `wm_onepurchase`;
CREATE TABLE `wm_onepurchase` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` varchar(255) NOT NULL DEFAULT '' COMMENT '商品id',
  `specifications` varchar(255) NOT NULL DEFAULT '' COMMENT '商品规格',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品价格',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '一元购标题',
  `num` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '单份金额',
  `peonum` mediumint(9) NOT NULL DEFAULT '0' COMMENT '当前期号已参与人数',
  `stime` int(10) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `etime` int(10) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '0.结束，1、开始',
  `codeclone` text NOT NULL COMMENT '号码库备份',
  `is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `code` text COMMENT '幸运号码库',
  `no` int(11) NOT NULL DEFAULT '1' COMMENT '第几期',
  `startnum` varchar(255) NOT NULL DEFAULT '100000' COMMENT '本期号码起始值',
  `is_disable` int(11) NOT NULL DEFAULT '1' COMMENT '是否禁启',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='一元购';

