DROP TABLE IF EXISTS `wm_onesetting`;
CREATE TABLE `wm_onesetting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `startnum` int(11) NOT NULL DEFAULT '0' COMMENT '活动起始值',
  `content` varchar(2000) DEFAULT '' COMMENT '描述',
  `ordertime` int(11) NOT NULL DEFAULT '7' COMMENT '订单期限',
  `timenum` int(11) NOT NULL DEFAULT '0' COMMENT '参与计算时间数量',
  `is_look` int(11) NOT NULL DEFAULT '0' COMMENT '是否前端显示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='一元购设置';

