DROP TABLE IF EXISTS `wm_onewinorder`;
CREATE TABLE `wm_onewinorder` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(255) NOT NULL DEFAULT '' COMMENT '订单编号',
  `p_id` int(11) DEFAULT '0' COMMENT '活动id',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员id',
  `goods_id` varchar(255) NOT NULL DEFAULT '0' COMMENT '商品id',
  `t_name` varchar(255) DEFAULT NULL COMMENT '收货人',
  `t_address` varchar(255) DEFAULT NULL COMMENT '收货地址',
  `t_tel` char(11) DEFAULT NULL COMMENT '收货人联系电话',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0待确认1待发货2待收货3待评价4已完成5已关闭',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_time` char(10) NOT NULL DEFAULT '0' COMMENT '下单时间-生成时间',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单价钱',
  `pay_time` char(10) NOT NULL DEFAULT '0' COMMENT '付款时间',
  `logistics_time` char(10) NOT NULL DEFAULT '0' COMMENT '配送时间',
  `end_time` char(10) NOT NULL DEFAULT '0' COMMENT '完成时间',
  `no` int(11) NOT NULL DEFAULT '0' COMMENT '期号',
  PRIMARY KEY (`id`),
  KEY `order_no` (`order_no`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='一元购中奖订单';

