#
# Structure for table "wm_order"
#

DROP TABLE IF EXISTS `wm_order`;
CREATE TABLE `wm_order` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `order_no` varchar(100) DEFAULT NULL COMMENT '订单编号',
  `member_id` mediumint(8) unsigned NOT NULL COMMENT '会员Id',
  `addtime` int(10) unsigned NOT NULL COMMENT '下单时间',
  `pay_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '支付状态，0未支付，1支付',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间',
  `total_price` decimal(10,2) DEFAULT '0.00' COMMENT '定单总价，实际付的钱，当有营销活动，也是指优惠后的钱，如果再使用了积分抵扣，则是指优惠后再积分抵扣的钱',
  `address_id` varchar(30) NOT NULL DEFAULT '' COMMENT '收件信息ID',
  `post_way` varchar(255) NOT NULL DEFAULT '0' COMMENT '配送方式，0为派送，1为物流，2为未确定发货',
  `post_time` char(10) DEFAULT '0' COMMENT '发货时间',
  `post_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发货状态,0：待付款、1：待发货、2：待收货,3：待评价,4：已完成,5：已关闭;',
  `post_number` varchar(30) NOT NULL DEFAULT '' COMMENT '当配送方式为物流时，填写快递运单号',
  `post_score` decimal(10,1) DEFAULT '5.0' COMMENT '派送评价分数',
  `freight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `note` varchar(255) DEFAULT NULL COMMENT '订单备注',
  `depart_id` int(11) DEFAULT NULL COMMENT '所属分店ID',
  `expect_receive_time` varchar(20) NOT NULL DEFAULT '0' COMMENT '预约派送时间',
  `start` int(11) NOT NULL DEFAULT '0' COMMENT '预定开始的时间',
  `end` int(11) NOT NULL DEFAULT '0' COMMENT '结束预定的时间',
  `order_from` varchar(255) NOT NULL DEFAULT '0' COMMENT '订单来源，0普通订单，1惠团购，2营销活动，3金币商城，4预订订单，5包月订单, 6限时抢购',
  `grouponid` int(11) DEFAULT NULL COMMENT '惠团购id',
  `is_group` int(11) NOT NULL DEFAULT '0' COMMENT '是否计算',
  `order_from_id` int(11) DEFAULT NULL,
  `fee_minus` decimal(10,2) DEFAULT NULL COMMENT '优惠金额，指营销活动，不包括积分抵扣',
  `gold` int(11) DEFAULT NULL COMMENT '所用金币',
  `gold_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '积分抵用的金额',
  `receive_time` char(10) DEFAULT NULL COMMENT '收货时间，客户或自动确认',
  `is_delected` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `prompt_tone` int(11) NOT NULL DEFAULT '0' COMMENT '提示音',
  `print_status` varchar(255) DEFAULT '0' COMMENT '打印状态，0：未打印；1：已打印过',
  `booking_num` int(11) NOT NULL DEFAULT '0' COMMENT '预定天数',
  `book_day` mediumint(9) NOT NULL DEFAULT '0' COMMENT '包月的天数',
  `remian_days` int(11) NOT NULL DEFAULT '0' COMMENT '包月剩余天数',
  `is_deal` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1未开始处理 2 正在处理部分订单商品 3 订单内商品处理完成',
  `is_making` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 未完成 1已完成',
  `order_make_time` int(11) NOT NULL DEFAULT '0' COMMENT '订单制作的完成时间',
  `is_print` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可以打印订单:0-不可以;1-可以;只有今天的订单才可以打印',
  PRIMARY KEY (`id`),
  KEY `member_id` (`member_id`),
  KEY `addtime` (`addtime`)
) ENGINE=InnoDB AUTO_INCREMENT=1966 DEFAULT CHARSET=utf8 COMMENT='定单基本信息';

