#
# Structure for table "wm_order_goods"
#

DROP TABLE IF EXISTS `wm_order_goods`;
CREATE TABLE `wm_order_goods` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `order_id` mediumint(8) unsigned NOT NULL COMMENT '定单Id',
  `goods_id` char(32) NOT NULL DEFAULT '0' COMMENT '商品Id',
  `goods_attr_id` varchar(150) NOT NULL DEFAULT '' COMMENT '商品属性id',
  `goods_number` mediumint(8) unsigned NOT NULL COMMENT '购买的数量',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '购买的单价',
  `is_book` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否预定，1表示预定，0表示正常购买',
  `activity_type` tinyint(3) DEFAULT '0' COMMENT '活动类型，0普通订单，1:优惠多少价格；2：折扣，3：买多少送多少，4：惠团购，5：积分抵扣,6限时抢购',
  `specifications` char(50) DEFAULT NULL COMMENT '商品规格',
  `isdone` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 未做完 2做完',
  `activity_id` int(11) NOT NULL DEFAULT '0' COMMENT '限时抢购的id',
  `yddays` mediumint(4) NOT NULL DEFAULT '0' COMMENT '产品的预定天数',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5848 DEFAULT CHARSET=utf8 COMMENT='定单商品表';

