#
# Structure for table "wm_rechargecash"
#

DROP TABLE IF EXISTS `wm_rechargecash`;
CREATE TABLE `wm_rechargecash` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员id',
  `type` varchar(255) DEFAULT NULL COMMENT '1，充值。2，提现',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `time` int(11) NOT NULL DEFAULT '0' COMMENT '时间',
  `is_ok` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否完成，0，待通过，1.通过/完成。2、拒绝',
  `pay_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '充值/提现的支付类型1.支付宝，2、微信 3bank4话费充值5团购返钱',
  `wx_url` varchar(255) DEFAULT NULL COMMENT '微信二维码',
  `alipay` varchar(255) DEFAULT '' COMMENT '支付宝账号',
  `alipayname` varchar(255) DEFAULT '' COMMENT '支付宝真实姓名',
  `bankclass` varchar(255) DEFAULT NULL COMMENT '银行卡类型',
  `bankaccount` varchar(255) DEFAULT NULL COMMENT '银行卡开户行',
  `bankcode` varchar(255) DEFAULT NULL COMMENT '银行卡卡号',
  `bankname` varchar(255) DEFAULT NULL COMMENT '银行卡人名',
  `telcash` char(11) DEFAULT NULL COMMENT '充值手机号',
  `note` varchar(255) DEFAULT '' COMMENT '备注',
  `tradeNo` varchar(255) NOT NULL DEFAULT '0' COMMENT '支付宝/微信的交易订单号码',
  PRIMARY KEY (`id`),
  KEY `type` (`type`),
  KEY `time` (`time`),
  KEY `is_ok` (`is_ok`),
  KEY `member_id` (`member_id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8 COMMENT='财务管理';

