DROP TABLE IF EXISTS `wm_times`;
CREATE TABLE `wm_times` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `open_shi` char(10) DEFAULT NULL COMMENT '开始时',
  `open_fen` char(10) DEFAULT NULL COMMENT '开始分',
  `open_miao` char(10) DEFAULT NULL COMMENT '开始秒',
  `close_shi` char(10) DEFAULT NULL COMMENT '休眠时',
  `close_fen` char(10) DEFAULT NULL COMMENT '休眠分',
  `close_miao` char(10) DEFAULT NULL COMMENT '休眠秒',
  `open_time` char(10) DEFAULT NULL COMMENT '开始时间',
  `close_time` char(10) DEFAULT NULL COMMENT '休眠时间',
  `frist_time` char(10) DEFAULT NULL COMMENT '新历第一次提示',
  `second_time` char(10) DEFAULT NULL COMMENT '新历第二次提示',
  `third_time` char(10) DEFAULT NULL COMMENT '新历第三次提醒',
  `frist_times` char(10) DEFAULT NULL COMMENT '农历第一次提醒',
  `second_times` char(10) DEFAULT NULL COMMENT '农历第二次提醒',
  `third_times` char(10) DEFAULT NULL COMMENT '农历第三次提醒',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='限定时间表';

