#
# Procedure "bmapgoods"
#

DROP PROCEDURE IF EXISTS `bmapgoods`;
CREATE PROCEDURE `bmapgoods`()
BEGIN
DROP TEMPORARY TABLE if exists wm_bmapgoods;
CREATE TEMPORARY TABLE wm_goodsinfo (

       goods_id int,
       class_id int,
       goods_name varchar(255),
       market_price numeric(10,2),
       shop_price numeric(10,2),
       sm_logo varchar(155),
       mid_logo varchar(155),
       is_new int,
       is_hot int,
       is_best int,
       stock mediumint(8),
       lon float(7,6),
       lat float(7,6),
       dname varchar(255),
       make_way int,
       is_bookable int,
       is_stock int,
       virtual_sell_amount int

) engine= memory;
insert into wm_goodsinfo(goods_id,class_id,goods_name,market_price,shop_price,sm_logo,mid_logo,is_new,is_hot,is_best,stock,lon,lat,dname,make_way,is_bookable,is_stock,virtual_sell_amount)
SELECT g.id as goods_id,g.class_id,g.goods_name,g.market_price,g.shop_price,g.sm_logo,g.mid_logo,g.is_new,g.is_hot,g.is_best,gm.stock,d.longitude as lon,d.latitude as lat,d.name as dname,g.make_way,is_bookable,is_stock,virtual_sell_amount
FROM wm_goods_management gm
INNER JOIN wm_goods g on g.id = gm.goods_id
INNER JOIN wm_departs d on d.id = gm.depart_id
WHERE gm.goods_status = 0 AND g.is_on_sale = 1 AND g.is_delete = 0 AND d.is_disable = 0 AND d.is_delete = 0 AND d.id<>1;

select * from wm_goodsinfo;

END;

