#
# Procedure "refined_bmapgood"
#

DROP PROCEDURE IF EXISTS `refined_bmapgood`;
CREATE PROCEDURE `refined_bmapgood`()
begin
DROP TEMPORARY TABLE if exists wm_goodsinfo;
CREATE TEMPORARY TABLE wm_goodsinfo (

       goods_id int,
       class_id int,
       goods_name varchar(255),
       market_price numeric(10,2),
       shop_price numeric(10,2),
       sm_logo varchar(155),
       mid_logo varchar(155),
       stock mediumint(8),
       lon float(7,6),
       lat float(7,6),
       make_way int,
       is_bookable int,
       is_stock int,
       virtual_sell_amount int,
       real_sell_amount int,
       depart_id int
       
) engine= memory;
#######查询的有 商品id 类别id 商品名称 市场价格 现价 小图 大图 库存 店铺经纬度 加工/非加工 是否需要库存 虚拟销量 店铺id
insert into wm_goodsinfo(goods_id,class_id,goods_name,market_price,shop_price,sm_logo,mid_logo,stock,lon,lat,make_way,is_bookable,is_stock,virtual_sell_amount,depart_id,real_sell_amount) 
SELECT 
       g.id as goods_id,g.class_id,g.goods_name,gm.market_price,
       gm.shop_price,g.sm_logo,g.mid_logo,gm.stock,d.longitude as lon,d.latitude as lat,
       g.make_way,g.is_bookable, g.is_stock,
       g.virtual_sell_amount,  d.id as depart_id,
       g.real_sell_amount
from wm_goods g 
join wm_goods_management gm on  g.id = gm.goods_id
left join wm_departs d on d.id = gm.depart_id
where g.goods_status = 0 AND g.is_on_sale = 1 AND g.is_delete = 0 AND 

d.is_disable = 0 AND d.is_delete = 0;

select * from wm_goodsinfo;
##这段存储过程的意义在于将家樂美食的附近的分店的经纬度全都统一到一张表 方便和其他表联合查询 不然条件过于复杂
end;
